import React from 'react';
import ReactDom from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

class App extends React.Component{
  render(){
    this.state= [
      { name:"Jon", age: 7},
      { name:"Jon", age: 17},
      { name:"Jon", age: 27},
    ]
  return (
      <h1>{this.state.name}</h1>
   )
  }
}

export default App;
